U\"},\"subContentId\":\"743545f8-6648-4831-8251-86d5cc570473\"}],\"helpTextLabel\":\"More information\",\"helpText\":\"\"},\"library\":\"H5P.StandardPage 1.5\",\"metadata\":{\"contentType\":\"Standard page\",\"license\":\"U\",\"title\":\"Problem\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Problem\"},\"subContentId\":\"6bb340e9-49bc-4bc4-8bae-a54319d40de9\"},{\"params\":{\"elementList\":[{\"params\":{\"text\":\"<p>O is equidistant from A and B, so O belongs to the perpendicular bisector of [AB].</p>\\n\\n<p>Also, O is equidistant from D and E, so O belongs to the perpendicular bisector of [DE].</p>\\n\\n<p>Thus, O is the point of intersection of the two perpendicular bisectors.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"12274957-0bcb-49f3-86b7-2a8a6a38a39e\"},{\"params\":{\"decorative\":false,\"contentName\":\"Image\",\"alt\":\"pr2.2\",\"file\":{\"path\":\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAC7cAAAOECAIAAABPK7ASAAAAAXNSR0IArs4c6QAAAAlwSFlzAAAOxAAADsQBlSsOGwAAQABJREFUeAHs3XeYVdW9N/BMYRg6DCBVkCIiig1FBRu2aOzYrho19mBJjFhiiEqCMZYQW7CBLRojsSv2GCsq8QqiIAoqyKX3OgwDM/P+Ltzw7PcMZYBh5Jz5nD8ma6+99j7r99nH4Qnny1pZZWVlP/IiQIAAAQIECBAgQIAAAQIECBAgQIAAAQIECBAgQIAAAQIECBAgkNEC2RldneIIECBAgAABAgQIECBAgAABAgQIECBAgAABAgQIECBAgAABAgQI/K+AlIzPAQECBAgQIECAAAECBAgQIECAAAECBAgQIECAAAECBAgQIECAQOYLSMlk/jNWIQECBAgQIECAAAECBAgQIECAAAECBAgQIECAAAECBAgQIECAgJSMzwABAgQIECBAgAABAgQIECBAgAABAgQIECBAgAABAgQIECBAgEDmC0jJZP4zViEBAgQIECBAgAABAgQIECBAgAABAgQIECBAgAABAgQIECBAgICUjM8AAQIECBAgQIAAAQIECBAgQIAAAQIECBAgQIAAAQIECBAgQIBA5gtIyWT+M1YhAQIECBAgQIAAAQIECBAgQIAAAQIECBAgQIAAAQIECBAgQICAlIzPAAECBAgQIECAAAECBAgQIECAAAECBAgQIECAAAECBAgQIECAQOYLSMlk/jNWIQECBAgQIECAAAECBAgQIECAAAECBAgQIECAAAECBAgQIECAgJSMzwABAgQIECBAgAABAgQIECBAgAABAgQIECBAgAABAgQIECBAgEDmC0jJZP4zViEBAgQIECBAgAABAgQIECBAgAABAgQIECBAgAABAgQIECBAgICUjM8AAQIECBAgQIAAAQIECBAgQIAAAQIECBAgQIAAAQIECBAgQI
